import React, { Fragment } from 'react';

class Carrousel extends React.Component {
    render() {


        return (

            <Fragment>




                        <main role="main">

                            <div className="cover-container d-flex flex-column .col-0 .col-sm-0" >
                                <div className=" row caja d-flex flex-column">
                                        <div className="montar d-flex flex-column .col-0 .col-sm-0 ">


                                            </div>
                                        <img src="img/fondo2.jpg" class="img-fluid" alt="Responsive image"/>

                                    </div>

                                    </div>



                        </main>





            </Fragment>




        )
    }
}

export default Carrousel;
